# 942. 增减字符串匹配
# 给定只含"I"（增大）或"D"（减小）的字符串S ，令N = S.length。
# 返回[0, 1, ..., N]的任意排列A使得对于所有i = 0, ..., N - 1，都有：如果S[i] == "I"，那么A[i] < A[i + 1]如果S[i] == "D"，那么A[i] > A[i + 1]

# 示例1：
# 输出："IDID"
# 输出：[0, 4, 1, 3, 2]

# 示例2：
# 输出："III"
# 输出：[0, 1, 2, 3]

# 示例3：
# 输出："DDI"
# 输出：[3, 2, 0, 1]


class Solution:

    # 思路正确，太耗时间
    def diStringMatch(self, S: str):
        s = []
        for i in S:
            s.append(i)

        A = []
        for i in range(len(s)+1):
            A.append(i)
        i = 0
        while i<len(s):
            if s[i]=='D':
                if A[i] > A[i+1]:
                    i = i + 1
                else:
                    A[i],A[i+1] = A[i+1],A[i]
                    i = 0
            else:
                if A[i] < A[i+1]:
                    i=i+1
                else:
                    A[i],A[i+1] = A[i+1],A[i]
                    i = 0
        return A




    # ——————————————————分割线——————————————————

    # 方法二
    def diStringMatch2(self, S: str):

        A = []
        for i in range(len(S)+1):
            A.append(i)

        res = []
        for i in S:
            if i=='I':
                res.append(A.pop(0))
            else:
                res.append(A.pop())
        res.append(A[0])

        return res



sol = Solution()
print(sol.diStringMatch2(""))
print(sol.diStringMatch2("DDI"))